measurements.description:
Thirteen flowers and two buds on 14 up to 40-cm inflorescences; 
presented on a robust 51.5-cm wide 60.5-cm high plant grown in a 25.4-cm round plastic pot in bark and moss; 
sepals recurved, cream, veining and margins blushed light fuchsia; petals porrect, recurved apically, cream heavily blushed fuchsia;
 lip cream mottled fuchsia, throat and callus bright yellow; 
 column cream tipped pale pink, anther cap cream; substance firm; texture matte; received flower quality award 20255356.
